nodes.caption:
Dear me,
For every time i stabbed you and mocked you;
For every minute i poisoned you with words;
For every night i imprisoned you in dark rooms;
For every second i tormented your weakness;
For every day i killed the girl you are;
Forgive me,
For you are stronger than you think;
For you are braver than your fears;
For you are youer than you.
